export async function loadModuleAsync(name): Promise<any> {
  //Autogenerated
  /* Webpack use module name for loading and computing code bundle and split chunk so we cannot introduce variable in the import thus we create this redirecting file*/
  switch (name) {
    case "@root/lib/modules/ammo/AmmoPhysics":
      return import("@root/lib/modules/ammo/AmmoPhysics");
    case "@root/lib/modules/controller/cameraController/OrbitController":
      return import(
        "@root/lib/modules/controller/cameraController/OrbitController"
      );
    case "@root/lib/modules/controller/pathFindingPlayer/Input":
      return import("@root/lib/modules/controller/pathFindingPlayer/Input");
    case "@root/lib/modules/controller/pathFindingPlayer/NavMeshPlayer":
      return import(
        "@root/lib/modules/controller/pathFindingPlayer/NavMeshPlayer"
      );
    case "@root/lib/modules/controller/physicPlayerControl/Input":
      return import("@root/lib/modules/controller/physicPlayerControl/Input");
    case "@root/lib/modules/controller/physicPlayerControl/PlayerControls":
      return import(
        "@root/lib/modules/controller/physicPlayerControl/PlayerControls"
      );
    case "@root/lib/modules/controller/PlayerService":
      return import("@root/lib/modules/controller/PlayerService");
    case "@root/lib/modules/core/WorldService":
      return import("@root/lib/modules/core/WorldService");
    case "@root/lib/modules/FrameLoop":
      return import("@root/lib/modules/FrameLoop");
    case "@root/lib/modules/portals/PortalLink":
      return import("@root/lib/modules/portals/PortalLink");
    case "@root/lib/modules/portals/PortalsService":
      return import("@root/lib/modules/portals/PortalsService");
    case "@root/lib/modules/scenes/demo1/GLTFScene":
      return import("@root/lib/modules/scenes/demo1/GLTFScene");
    case "@root/lib/modules/scenes/demo2/LevelSetup":
      return import("@root/lib/modules/scenes/demo2/LevelSetup");
    case "@root/lib/modules/scenes/demo2/Sky2":
      return import("@root/lib/modules/scenes/demo2/Sky2");
    case "@root/lib/modules/spoke/SpokeRoomLoader":
      return import("@root/lib/modules/spoke/SpokeRoomLoader");
    case "@root/lib/modules/three/ThreeLib":
      return import("@root/lib/modules/three/ThreeLib");
    default:
      throw new Error(
        name + " not found in module list - please run npm run pre-build"
      );
  }
}
